// import React from 'react';
import * as React from 'react';
import {useState, useEffect} from 'react';
import {useNavigate} from 'react-router-dom';
import axios from 'axios';
import AccessAlarmIcon from '@mui/icons-material/AccessAlarm';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';
// import Tooltip from '@mui/material/Tooltip';
import MenuItem from '@mui/material/MenuItem';

import './Home.css';

const pages = ['Dish', 'Cuisine', 'Ingredients', 'Type'];
/**
 * Simple component with no state.
 *
 * See the basic-react example for an example of adding and reacting to
 * changes in state and lecture 10 for details on Material-UI
 *
 * @return {object} JSX
 */
export default function Home() {
  const [anchorElNav, setAnchorElNav] = React.useState(null);
  const [recipesList, setRecipesList] = useState([]);
  const navigate = useNavigate();

  const navigateToCuisine = () => {
    navigate('/cuisine');
  };

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  // useEffect(() => {
  //   const res = axios.get('https://api.spoonacular.com/recipes/random', {
  //     params: {apiKey: 'c33d1c92ed8343d7b6522ddb630cdfd4', number: 15},
  //   });
  //   setRecipesList(res.data.recipes);
  // }, [recipesList]);

  useEffect(() => {
    axios
      .get(`https://api.spoonacular.com/recipes/random`, {
        params: {apiKey: 'c33d1c92ed8343d7b6522ddb630cdfd4', number: 15},
      })
      .then((res) => {
        setRecipesList(res.data.recipes);
      });
  }, [recipesList]);

  // const randRecipes = async () => {
  //   const res = await axios.get('https://api.spoonacular.com/recipes/random', {
  //     params: {apiKey: 'c33d1c92ed8343d7b6522ddb630cdfd4', number: 15},
  //   });
  //   setRecipesList(res.data.recipes);
  //   // console.log(recipesList);
  //   // const RL = recipesList.map((recipe) => recipe.title);
  //   // console.log(RL);
  // };
  // // randRecipes();
  return (
    <div>
      {/* <h1 className='title'>AKALAT</h1> */}
      <AppBar position='static'>
        <Container maxWidth='xl'>
          <Toolbar disableGutters>
            <Typography
              variant='h6'
              noWrap
              component='a'
              href='#app-bar-with-responsive-menu'
              sx={{
                mr: 2,
                display: {xs: 'none', md: 'flex'},
                fontFamily: 'monospace',
                fontWeight: 700,
                letterSpacing: '.3rem',
                color: 'inherit',
                textDecoration: 'none',
              }}
            >
              AKALAT
            </Typography>

            <Box sx={{flexGrow: 1, display: {xs: 'flex', md: 'none'}}}>
              <IconButton
                size='large'
                aria-label='account of current user'
                aria-controls='menu-appbar'
                aria-haspopup='true'
                onClick={handleOpenNavMenu}
                color='inherit'
              >
                <MenuIcon />
              </IconButton>
              <Menu
                id='menu-appbar'
                anchorEl={anchorElNav}
                anchorOrigin={{
                  vertical: 'bottom',
                  horizontal: 'left',
                }}
                keepMounted
                transformOrigin={{
                  vertical: 'top',
                  horizontal: 'left',
                }}
                open={Boolean(anchorElNav)}
                onClose={handleCloseNavMenu}
                sx={{
                  display: {xs: 'block', md: 'none'},
                }}
              >
                {pages.map((page) => (
                  <MenuItem key={page} onClick={handleCloseNavMenu}>
                    <Typography textAlign='center'>{page}</Typography>
                  </MenuItem>
                ))}
              </Menu>
            </Box>
            <Typography
              variant='h5'
              noWrap
              component='a'
              href='#app-bar-with-responsive-menu'
              sx={{
                mr: 2,
                display: {xs: 'flex', md: 'none'},
                flexGrow: 1,
                fontFamily: 'monospace',
                fontWeight: 700,
                letterSpacing: '.3rem',
                color: 'inherit',
                textDecoration: 'none',
              }}
            >
              AKALAT
            </Typography>
            <Box sx={{flexGrow: 1, display: {xs: 'none', md: 'flex'}}}>
              {pages.map((page) => (
                <Button
                  key={page}
                  onClick={handleCloseNavMenu}
                  sx={{my: 2, color: 'white', display: 'block'}}
                >
                  {page}
                </Button>
              ))}
            </Box>
          </Toolbar>
        </Container>
      </AppBar>
      <button className='button1'>Dish</button>
      <button onClick={navigateToCuisine} className='button2'>
        Cuisine
      </button>
      <button className='button3'>Ingredients</button>
      <h2 className='explore'>Explore</h2>
      {recipesList.map((recipe) => (
        <div className='randRecipeList' key={recipe.title}>
          <ul>
            {/* <li>
              <img src={recipe.image} alt={'k'} />
            </li>
            <li>{recipe.title}</li> */}
            <li>
              {recipe.title}
              <img src={recipe.image} alt={'k'} />
              <AccessAlarmIcon></AccessAlarmIcon>
              {recipe.readyInMinutes}
            </li>
          </ul>
        </div>
      ))}
    </div>
  );
}
